 - 6:00 PM).\n\n5) En caso de no encontrarse en el sitio pactado para la entrega, deberá pagar el envío para llevárselo nuevamente.\n\n6) Cualquier incidente con la mercancía recibida deberá ser reportado dentro de las 72 horas posteriores a la entrega del pedido.\n\n',1,'2021-05-15 11:44:42.775000',NULL),(25,'PRINT_ORDER','Impresión de Ordenes','<header>{{> printHeader }}</header> <div class=\"wrapper\">     <header class=\"header\">         <div class=\"logo\" id=\"logo_11\">             <span id=\"total_11\">{{deliveryShortType}}: {{order.deliveryMethod.name}} {{#if isChargeOnDelivery}} {{currency order.totalAmount}} {{/if}} </span><br>             <span style=\"font-size: 1.2em\">             {{#if hasPayment}}                 {{#if isCash}}                     EFECTIVO                 {{else}}                     TRANSFERENCIA                 {{/if}}             {{/if}}             {{#if hasPiecesForChanges}}             Piezas para cambio: {{order.piecesForChanges}}             {{/if}}             </span>         </div>         <div class=\"order_info\">             {{{qrBar}}}             <p><strong># Pedido:</strong> {{order.id}}</p>         </div>         <div class=\"client_info\">             <p>                 <strong>Cliente:</strong>                 {{order.customer.name}}                     <strong>CC/NIT:</strong> {{order.customer.document}} </p>             <p><strong>Dirección:</strong> <strong>{{order.customer.municipality.name}}</strong> <strong>Dpto.:</strong> {{order.customer.state.name}}</p>             <p><strong>Teléfonos:</strong> {{order.customer.cellphone}} {{order.customer.phone}}</p>         </div>         {{#if hasComments}}         <h2>Observaciones</h2>         <table style=\"color:red\">             {{#each comments}}             <tr>                 <td>{{user.name}} {{user.lastname}} ({{dateFormat createdAt format=\'YYYY-MM-DD HH:mm:ss\'}}): {{comment}}</td>             </tr>             {{/each}}         </table>         {{/if}}         <div class=\"client_info2\">             <table style=\"width:100%;\">                 <tbody>                 <tr>                     <td style=\"width:30%;\">Pedido # {{order.id}}</td>                     <td style=\"width:35%; text-align: center;\">Fecha - Hora</td>                     <td style=\"width:35%; text-align: center;\">Preparador</td>                 </tr>                 <tr>                     <td>                         {{order.customer.name}}                     </td>                     <td></td>                     <td></td>                 </tr>                 </tbody>             </table>         </div>     </header>     <div class=\"content\">         <table>             <thead>             <tr>                 <td>                     Ref.                 </td>                 <td>                     Color                 </td>                 <td>                     Talla                 </td>                 <td style=\"text-align: right;\">                     Cant.                 </td>                 <td style=\"text-align: right;\">                     Precio c/desc.                 </td>             </tr>             </thead>             <tbody>             {{#each orderDetails}}             <tr>                 <td style=\"font-weight: bold;\">                     {{product.reference}}                        </td>                 <td style=\"font-weight: bold;\">                     {{color}}                        </td>                 <td style=\"font-weight: bold;\">                     {{size}}                        </td>                 <td style=\"text-align: right;font-weight: bold;\">                     {{quantity}}                        </td>                 <td style=\"text-align: right;\">                     {{scurrency price}}                        </td>             </tr>             {{/each}}             </tbody>         </table>     </div>     <div class=\"footer\">         <div class=\"imprimir\">          </div>         <div class=\"order_total\">             <p>Cantidad de piezas: <strong>{{order.quantity}}</strong></p>             <p>Subtotal: <strong>{{scurrency order.subTotal}}</strong></p>             <p>Envío: <strong>{{scurrency order.orderDelivery.deliveryCost}}</strong></p>             <p>Total: <strong>{{scurrency order.totalAmount}}</strong></p>         </div>     </div> </div> ',1,'2021-05-01 00:00:00.000000',1),(29,'PRINT_CATALOG_LIST','Plantilla de Catalogo','<head>{{> catalogHeader }}</head><body><div class=\"row\"> {{#each products}} <div class=\"col s6\" style=\"padding-{{borderNumber @index}}: 0px\"> <div class=\"card producto-lista-pdf\"> <div class=\"card-image\"> <img src=\"{{ imagePrimary }}\"> <div class=\"marca-agua\">{{reference}}</div> <div class=\"mini\"> <img src=\"{{ imageSecondary }}\"> </div> </div> <div class=\"card-content\"> <span class=\"card-title codigo\"> <label>{{description}}</label> <b style=\"font-weight:bold\">{{reference}}</b> </span> {{#if @root.hasPrice}} <div class=\"precio\" style=\"font-weight:bold;\"> <cite>$ {{ scurrency priceDiscount }}</cite> <b style=\"font-weight:bold\">$ {{ scurrency price }}</b> </div> {{/if}} <div class=\"material\">{{material}}</div> <div class=\"tallas\"> {{#each productSize}} <div class=\"chip\" style=\"background-color: #e4e4e4\"> <p>{{name}}</p> </div> {{/each}} </div> </div> </div> </div> {{/each}}</div></body>',1,'2021-05-01 00:00:00.000000',1),(30,'EXPORT_OFFICE_INTERRAPIDISIMO','Plantilla para Interrapidisimo','<div class=\"row\">\nM<div class=\"row\">\nREPORTE DE INTERRAPIDISIMO - PLANTILLA PERSONALIZADA...  \n</div>',1,'2021-05-01 00:00:00.000000',NULL),(31,'COPY_RESUME_CONTRAPAGO_INTERRAPIDISIMO_PAID','COPY_RESUME_CONTRAPAGO_INTERRAPIDISIMO_PAID','Prueba',1,'2021-10-16 13:00:22.528897',NULL),(32,'OFFICE_PDF','Plantilla para descarga PDF Despacho','<head>{{> officePdf }}</head>\n<body>\n{{#each orders}}\n<div class=\"wrapper\">\n    <div class=\"card\">\n        <div class=\"row\">\n            <div class=\"col s8\">\n                <label>Nombre</label>\n                <p style=\"text-transform: uppercase\">{{customer.name}}</p>\n            </div>\n            <div class=\"col s4\">\n                <label>CC / NIT</label>\n                <p style=\"text-transform: uppercase\">{{customer.document}}</p>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col s12\">\n                <label>Dirección</label>\n                <p style=\"background-color: yellow; font-weight: bold;text-transform: uppercase;\">{{customer.address}}</p>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col s4\">\n                <label>Ciudad</label>\n                <p style=\"background-color: yellow; font-weight: bold;text-transform: uppercase;\"></p>\n            </div>\n            <div class=\"col s4\">\n                <label>Municipio</label>\n                <p style=\"background-color: yellow; font-weight: bold;text-transform: uppercase\">{{customer.municipality.name}}</p>\n            </div>\n            <div class=\"col s4\">\n                <label>Departamento</label>\n                <p style=\"background-color: yellow; font-weight: bold;text-transform: uppercase\">{{customer.state.name}}</p>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col s4\">\n                <label>Teléfonos</label>\n                <p>{{customer.phone}}<br/>{{customer.cellphone}}</br></p>\n            </div>\n            <div class=\"col s8\">\n                <label>Email</label>\n                <p style=\"text-transform: uppercase\">{{customer.email}}</p>\n            </div>\n        </div>\n    </div>\n    <div class=\"card\">\n        <div class=\"row\">\n            <div class=\"col s4\">\n                <label>Peso</label>\n                <p style=\"color: red; font-weight: bold;\">\n                    {{normalizeWeight totalWeight}}\n                </p>\n            </div>\n            <div class=\"col s4\">\n                <label>Tipo</label>\n                {{#ifCond orderDelivery.deliveryType \'==\' 3}}\n                <p style=\"color: red; font-weight: bold;\">CONTRA ENTREGA</p>\n                {{/ifCond}}\n                {{#ifCond orderDelivery.deliveryType \'==\' 1}}\n                <p style=\"color: red; font-weight: bold;\">CONTADO</p>\n                {{/ifCond}}\n                {{#ifCond orderDelivery.deliveryType \'==\' 2}}\n                    {{#ifCond deliveryMethod.code \'==\' \'INTERRAPIDISIMO\'}}\n                        <p style=\"color: red; font-weight: bold;\">AL COBRO</p>\n                    {{/ifCond}}\n                    {{#ifCond deliveryMethod.code \'==\' \'SERVIENTREGA\'}}\n                    <p style=\"color: red; font-weight: bold;\">COD</p>\n                    {{/ifCond}}\n                {{/ifCond}}\n            </div>\n            <div class=\"col s4\">\n                <label>Método de envío</label>\n                <p style=\"color: red; font-weight: bold;text-transform: uppercase;\">{{deliveryMethod.name}}</p>\n            </div>\n        </div>\n    </div>\n</div>\n{{/each}}\n</body>\n',1,'2021-10-16 13:00:22.528897',1);
